import Helmet from "react-helmet";
import React from 'react';
import './Team.css';
import Navbar from "../../components/Navbar";

const Team = () => {
    return (
        <div className="team">
        <Helmet bodyAttributes={{style: 'background-color : var(--color-light-green)'}}/>
            <Navbar></Navbar>
            <div className="team-body">
            <h2>Privacy</h2>

            </div>
        </div>   
    )
};

export default Team;
